import { ThemeProvider } from "styled-components";
import GlobalStyles from "./styles/GlobalStyles";
import { dark } from "./styles/Themes";

function App() {
  return (
    <>
      <ThemeProvider theme={dark}>
        <GlobalStyles />
        <main className="App">App File</main>
      </ThemeProvider>
    </>
  );
}

export default App;
